import { Navbar, Container, Nav } from "react-bootstrap";

const NavBar = () => {
    return (
        <div>
            <Navbar bg="black">
                <Container>

                        <Nav.Link>Home</Nav.Link>
                        <Nav.Link>Daftar Film</Nav.Link>
                </Container>
            </Navbar>
        </div>
    );
}
export default NavBar;
